  'description' => 
  array (
    'en_US' => '<!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:HyphenationZone>21</w:HyphenationZone> <w:PunctuationKerning /> <w:ValidateAgainstSchemas /> <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid> <w:IgnoreMixedContent>false</w:IgnoreMixedContent> <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText> <w:Compatibility> <w:BreakWrappedTables /> <w:SnapToGridInCell /> <w:WrapTextWithPunct /> <w:UseAsianBreakRules /> <w:DontGrowAutofit /> </w:Compatibility> <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel> </w:WordDocument> </xml><![endif]--><!--[if gte mso 9]><xml> <w:LatentStyles DefLockedState="false" LatentStyleCount="156"> </w:LatentStyles> </xml><![endif]--> <br /><p>The development of this first meeting has as purpose to contribute to knowledge of semiconductor devices modeling and&nbsp;electronic materials, in order to discuss the most widely used computational methods to study the materials and their application to electron devices. The event, organized in a single-session format, will be carried out with the contribution of <strong>invited lecturers</strong> and <strong>poster presentations</strong>.</p> The workshop will be addressed to researchers in the areas of semiconductor devices modeling and new materials. Also, professionals related to the electronic industry and PhD and advanced students of the careers of Electronic Engineering and Physics.',
    'es_ES' => '<p><!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:HyphenationZone>21</w:HyphenationZone> <w:PunctuationKerning /> <w:ValidateAgainstSchemas /> <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid> <w:IgnoreMixedContent>false</w:IgnoreMixedContent> <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText> <w:Compatibility> <w:BreakWrappedTables /> <w:SnapToGridInCell /> <w:WrapTextWithPunct /> <w:UseAsianBreakRules /> <w:DontGrowAutofit /> </w:Compatibility> <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel> </w:WordDocument> </xml><![endif]--><!--[if gte mso 9]><xml> <w:LatentStyles DefLockedState="false" LatentStyleCount="156"> </w:LatentStyles> </xml><![endif]-->El desarrollo de esta primera reuni&oacute;n tiene como objetivo contribuir al conocimiento sobre modelizaci&oacute;n de dispositivos semiconductores y materiales electr&oacute;nicos, con el prop&oacute;sito de discutir los m&eacute;todos computacionales m&aacute;s ampliamente utilizados para el estudio de los materiales y sus aplicaciones a los dispositivos electr&oacute;nicos. El evento, organizado en una &uacute;nica sesi&oacute;n, ser&aacute; llevado a cabo con la contribuci&oacute;n de <strong>conferencistas invitados</strong> y <strong>presentaciones en formato p&oacute;ster</strong>.</p><p>El workshop ser&aacute; direccionado a investigadores en las &aacute;reas de modelizaci&oacute;n de dispositivos semiconductores y nuevos materiales, profesionales relacionados a la industria electr&oacute;nica, doctorandos y alumnos avanzados de las carreras de Ingenier&iacute;a Electr&oacute;nica y F&iacute;sica.</p><p>&nbsp;</p>',
